query:
SELECT STRFTIME('%Y-%m', timestamp) AS message_month, msg_name, COUNT(*) AS total_count
FROM message
GROUP BY message_date, msg_name;

SELECT STRFTIME('%Y-%m', timestamp) AS message_date, msg_name, COUNT(*) AS total_count
FROM message
GROUP BY message_date, msg_name;

SELECT STRFTIME('%Y-%m-%d', timestamp) AS message_date, msg_name, COUNT(*) AS total_count
FROM message
GROUP BY message_date, msg_name;
